  onClick(){
    console.log("AAAAA");
  }
  render(){

  var product = [
      {
        id  : 1,
        name: "NhatQuang",
        age : 18,
        stt : true
      },
      {
        id  : 2,
        name: "Quang Nhat",
        age : 20, 
        stt : true
      },
      {
        id  : 3,
        name: "Quang Quang",
        age : 21,
        stt : false
      }
  ];

  let elements = product.map((product, indexn) =>{
      let result = '';
      if(product.stt){
        result = <Product
                  key = {product.index}
                  name = {product.name}
                  age = {product.age}
                > 
                </Product>
      }
      return result; 
  });
  return (
    <div className="App">
      {elements}
      <button type = "button"  onClick={this.onClick} > 
        Click me 
      </button>
    </div>
  );
}
}
export default App;
